injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-c6e770294bb0a",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\importantProgramm\\vuepress-devkit\\docs\\README.md").then(comp => {
        Vue.component("v-c6e770294bb0a", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-965e794c481f4",
    path: "/accumulate/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\importantProgramm\\vuepress-devkit\\docs\\accumulate\\README.md").then(comp => {
        Vue.component("v-965e794c481f4", comp.default)
        next()
      })
    }
  },
  {
    path: "/accumulate/index.html",
    redirect: "/accumulate/"
  },
  {
    name: "v-30f0bec0933fb",
    path: "/algorithm/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\importantProgramm\\vuepress-devkit\\docs\\algorithm\\README.md").then(comp => {
        Vue.component("v-30f0bec0933fb", comp.default)
        next()
      })
    }
  },
  {
    path: "/algorithm/index.html",
    redirect: "/algorithm/"
  },
  {
    name: "v-eb6fa69b82649",
    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\importantProgramm\\vuepress-devkit\\docs\\guide.md").then(comp => {
        Vue.component("v-eb6fa69b82649", comp.default)
        next()
      })
    }
  },
  {
    name: "v-634f8771a1e5b",
    path: "/others/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\importantProgramm\\vuepress-devkit\\docs\\others\\README.md").then(comp => {
        Vue.component("v-634f8771a1e5b", comp.default)
